-- create users table:
IF OBJECT_ID('users', 'U') IS NOT NULL
    DROP TABLE users;
GO

CREATE TABLE users (
    user_id INT NOT NULL PRIMARY KEY,
    name VARCHAR(100) NULL,
    gender VARCHAR(10) NULL,
    age INT NULL,
    city VARCHAR(100) NULL,
    plan_type VARCHAR(20) NULL,
    join_date DATE NULL
);
